"use strict";
var helpers = require('syracuse-core/lib/helpers');

function Slot(){
}

exports.Slot = helpers.defineClass(Slot, null, {
    loadBox: function(){
        var slot = document.createElement("div");
        slot.setAttribute("id", this.$item.$id);
        this.$$item = $(slot).appendTo(this.$$container);
    },
	dispose : function(){
		
	}	
});